"use client"

import { useState } from "react"
import { Link as RouterLink, useLocation } from "react-router-dom"
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
  Divider,
  Avatar,
  Menu,
  MenuItem,
} from "@mui/material"
import MenuIcon from "@mui/icons-material/Menu"
import SportsSoccerIcon from "@mui/icons-material/SportsSoccer"
import { useAuth } from "../contexts/auth-context"

export default function Navbar() {
  const location = useLocation()
  const { user, logout } = useAuth()
  const [drawerOpen, setDrawerOpen] = useState(false)
  const [anchorEl, setAnchorEl] = useState(null)

  const handleDrawerToggle = () => {
    setDrawerOpen(!drawerOpen)
  }

  const handleProfileMenuOpen = (event) => {
    setAnchorEl(event.currentTarget)
  }

  const handleProfileMenuClose = () => {
    setAnchorEl(null)
  }

  const handleLogout = () => {
    logout()
    handleProfileMenuClose()
  }

  const isMenuOpen = Boolean(anchorEl)

  const navItems = [
    { name: "Home", path: "/" },
    { name: "Venues", path: "/venues" },
    { name: "How It Works", path: "/how-it-works" },
    { name: "Contact", path: "/contact" },
  ]

  const drawer = (
    <Box onClick={handleDrawerToggle} sx={{ textAlign: "center" }}>
      <Box sx={{ display: "flex", alignItems: "center", justifyContent: "center", p: 2 }}>
        <SportsSoccerIcon />
        <Typography variant="h6" sx={{ ml: 1 }}>
          SportSpot
        </Typography>
      </Box>
      <Divider />
      <List>
        {navItems.map((item) => (
          <ListItem
            key={item.name}
            button
            component={RouterLink}
            to={item.path}
            sx={{
              color: location.pathname === item.path ? "primary.main" : "inherit",
              fontWeight: location.pathname === item.path ? "bold" : "normal",
            }}
          >
            <ListItemText primary={item.name} />
          </ListItem>
        ))}
        <Divider sx={{ my: 1 }} />
        {user ? (
          <>
            <ListItem component={RouterLink} to="/dashboard">
              <ListItemText primary="My Bookings" />
            </ListItem>
            <ListItem component={RouterLink} to="/profile">
              <ListItemText primary="Profile" />
            </ListItem>
            <ListItem button onClick={logout}>
              <ListItemText primary="Logout" />
            </ListItem>
          </>
        ) : (
          <>
            <ListItem component={RouterLink} to="/login">
              <ListItemText primary="Login" />
            </ListItem>
            <ListItem component={RouterLink} to="/register">
              <ListItemText primary="Register" />
            </ListItem>
          </>
        )}
      </List>
    </Box>
  )

  return (
    <>
      <AppBar position="sticky" color="default" elevation={1} sx={{ bgcolor: "background.paper" }}>
        <Toolbar>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            onClick={handleDrawerToggle}
            sx={{ mr: 2, display: { sm: "none" } }}
          >
            <MenuIcon />
          </IconButton>

          <Box sx={{ display: "flex", alignItems: "center" }}>
            <SportsSoccerIcon />
            <Typography
              variant="h6"
              component={RouterLink}
              to="/"
              sx={{
                ml: 1,
                textDecoration: "none",
                color: "inherit",
              }}
            >
              SportSpot
            </Typography>
          </Box>

          <Box sx={{ display: { xs: "none", sm: "flex" }, ml: 4 }}>
            {navItems.map((item) => (
              <Button
                key={item.name}
                component={RouterLink}
                to={item.path}
                sx={{
                  color: "inherit",
                  fontWeight: location.pathname === item.path ? "bold" : "normal",
                  borderBottom: location.pathname === item.path ? 2 : 0,
                  borderColor: "primary.main",
                  borderRadius: 0,
                  mx: 1,
                }}
              >
                {item.name}
              </Button>
            ))}
          </Box>

          <Box sx={{ flexGrow: 1 }} />

          {user ? (
            <Box sx={{ display: "flex", alignItems: "center" }}>
              <Button
                onClick={handleProfileMenuOpen}
                sx={{ textTransform: "none", display: "flex", alignItems: "center" }}
              >
                <Avatar sx={{ width: 32, height: 32, mr: 1 }}>
                  {user.name?.charAt(0) || "U"}
                </Avatar>
                <Typography sx={{ display: { xs: "none", md: "block" } }}>
                  {user.name || "User"}
                </Typography>
              </Button>
              <Menu
                anchorEl={anchorEl}
                open={isMenuOpen}
                onClose={handleProfileMenuClose}
                PaperProps={{ elevation: 3, sx: { minWidth: 180 } }}
              >
                <MenuItem component={RouterLink} to="/dashboard" onClick={handleProfileMenuClose}>
                  My Bookings
                </MenuItem>
                <MenuItem component={RouterLink} to="/profile" onClick={handleProfileMenuClose}>
                  Profile
                </MenuItem>
                <Divider />
                <MenuItem onClick={handleLogout}>Logout</MenuItem>
              </Menu>
            </Box>
          ) : (
            <Box sx={{ display: { xs: "none", sm: "block" } }}>
              <Button component={RouterLink} to="/login" color="inherit" sx={{ mr: 1 }}>
                Login
              </Button>
              <Button component={RouterLink} to="/register" variant="contained" sx={{ borderRadius: 2 }}>
                Register
              </Button>
            </Box>
          )}
        </Toolbar>
      </AppBar>

      <Drawer
        variant="temporary"
        open={drawerOpen}
        onClose={handleDrawerToggle}
        ModalProps={{ keepMounted: true }}
        sx={{
          display: { xs: "block", sm: "none" },
          "& .MuiDrawer-paper": { boxSizing: "border-box", width: 240 },
        }}
      >
        {drawer}
      </Drawer>
    </>
  )
}
